    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      height : '100px',
      marginTop: '2'
    },
  }));


const Event = ({name}) => {
    const classes = useStyles();
    return ( 
        <Paper className={classes.paper}>{name}</Paper>
     );
}
 
